import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Home from './components/Home';
import Profile from './components/Profile';
import Forum from './components/Forum';
import Blog from './components/Blog';
//import Login from './components/Login';
import Register from './components/Register';
import Sidebar from './components/Sidebar';
import Header from './components/Header';
import Grid2 from '@mui/material/Grid2'; // ใช้ Grid2 จาก MUI
import { Container } from '@mui/material'; // ใช้ Container สำหรับการจัดการเลย์เอาต์

const App = () => {
  return (
    <Container spacing={2}>
      <Grid2 container spacing={2}>
        <Grid2 xs={12} sm={3}> {/* Sidebar อยู่ด้านซ้าย */}
          <Sidebar />
        </Grid2>
        <Grid2 xs={12} sm={9}> {/* เนื้อหาที่อยู่ถัดจาก Sidebar */}
          <Header />
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/profile" element={<Profile />} />
            <Route path="/forum" element={<Forum />} />
            <Route path="/blog" element={<Blog />} />
            <Route path="/register" element={<Register />} />
          </Routes>
        </Grid2>
      </Grid2>
    </Container>
  );
};

export default App;
